Magpie
```json
{
  "application": "Magpie",
  "description": "Magpie is a set of scripts for running Hadoop on traditional HPC systems. It provides a way to launch and manage distributed big data applications on cluster environments, including setting up configurations, launching daemons, and managing job execution.",
  "software_requirements": [
    "Java",
    "Python",
    "Alluxio",
    "SLURM"
  ],
  "resource_requirements": {
    "nodes": {
      "type": "int",
      "description": "Number of nodes to allocate for the job, including the head node."
    },
    "time": {
      "type": "str",
      "format": "HH:MM:SS",
      "description": "Time limit for the job in the format HH:MM:SS."
    },
    "memory": {
      "type": "str",
      "format": "[0-9]+[GMK]?",
      "description": "Memory requirements per node."
    }
  },
  "additional_info": {
    "dependencies": [
      "NFS",
      "Lustre"
    ],
    "configuration_files": [
      "magpie/conf/alluxio/alluxio-site.properties",
      "magpie/conf/hadoop/core-site.xml",
      "magpie/conf/hadoop/hdfs-site.xml",
      "magpie/conf/hadoop/mapred-site.xml",
      "magpie/conf/hadoop/yarn-site.xml",
      "magpie/conf/hbase/hbase-site.xml"
    ],
    "scripts": [
      "magpie-check-inputs",
      "magpie-setup-core",
      "magpie-setup-projects",
      "magpie-setup-post",
      "magpie-pre-run",
      "magpie-run",
      "magpie-cleanup",
      "magpie-post-run"
    ]
  }
}
```
